"1. આ રાઉન્ડમાં જોડાવા માટે \"જોડાઓ\" પર ક્લિક કરો;
2. અન્ય લોકો કે જેઓ સીધું માઇક લે છે તે પણ ગેમમાં જોડાઈ શકે છે;
3. ગેમ શરૂ કરવા માટે તમારે ઓછામાં ઓછા 2 લોકોની જરૂર છે;
4. નિષ્પક્ષ બનવા માટે, ગેમ શરૂ થયા પછી, જ્યાં સુધી તે વપરાશકર્તા નાબૂદ ન થાય અથવા ગેમ સમાપ્ત ન થાય ત્યાં સુધી તમે ખેલાડીને ગેમમાંથી દૂર કરી શકતા નથી;
5. ❤ પર ક્લિક કરીને, તમે ગેમ માર્ગદર્શિકાઓની સમીક્ષા કરી શકો છો;"

"1. દૂર કરવામાં આવેલ લોકોનો સ્કોર ચાલુ રહેશે નહીં, તેથી સ્કોરબોર્ડ કાઢી નાખવામાં આવશે;
2. માઇક્સ ધરાવતા વપરાશકર્તાઓ ગેમની મધ્યમાં રમતમાં જોડાઈ શકશે નહીં;
3. જો તમે માઈક છોડો છો અથવા ગેમની વચ્ચે રૂમ છોડી દો છો, તો તમને છોડનાર તરીકે ગણવામાં આવશે. તમને દૂર કરવામાં આવશે અને તમે ગેમ પર પાછા જઈ શકશો નહીં;
4. બેઠકો બદલવાથી સ્કોરને અસર થશે નહીં;"

"1. દરેક રાઉન્ડનું કાઉન્ટડાઉન માલિક દ્વારા પસંદ કરવામાં આવે છે;
2. કાઉન્ટડાઉન સમાપ્ત થયા પછી, લક્ષિત લોકોને હટાવવા માટે સ્નાઇપર શૂટ કરશે;
3. એક વ્યક્તિને હટાવ્યા પછી, આગામી રાઉન્ડનું કાઉન્ટડાઉન તરત જ શરૂ થશે;"

"1. ગેમ શરૂ થયા પછી, સ્કોર પ્રાપ્ત થયેલા હીરાના સ્કોર પર આધારિત હશે;
2. સૌથી ઓછો સ્કોર ધરાવતા લોકોને સ્નાઇપર વડે લક્ષિત કરવામાં આવશે;
3. જો સૌથી ઓછો સમાન સ્કોર ધરાવતા બહુવિધ લોકો હશે, તો તે તમામ લોકોને સ્નાઇપર વડે લક્ષિત કરવામાં આવશે;"
